# Data Parser

samples = 133

def data_parser(path):
    wav_file = [None] * samples
    speaker = np.zeros(samples, dtype=int)
    digit = np.zeros(samples, dtype=int)
    
    for i, file in enumerate(os.listdir(path)):
        filename = file
        wav_file[i], _ = librosa.load(os.path.join(path, filename), sr=16000)
        digit_speaker = filename.split('.')[0]  # Keep speaker and digit

        # extract digit
        d = ""
        for c in digit_speaker:
            if c.isalpha():
                d += c
        digit[i] = w2n.word_to_num(d)

        # extract speaker
        s = ""
        for c in digit_speaker:
            if not c.isalpha():
                s += c
        speaker[i] = w2n.word_to_num(s)
     
    return wav_file, speaker, digit

data_dir = "digits"
wav_file, speaker, digit = data_parser(data_dir)

print("First 10 parsed files:\n")
for i in range(10):
    print("wav_file: " + str(i+1) + " speaker =" + str(speaker[i]) + " digit =" + str(digit[i]))

