"""Παρατηρούμε ότι η ακρίβεια των "παραδοσιακών" ταξινομητών είναι αρκετά χαμηλή.

**ΒΗΜΑ 8**

### Εκπαίδευση Αναδρομικού Νευρωνικού Δικτύου 



> Αρχικά δημιουργούμε ακολουθίες 10 σημείων ενός ημιτόνου και ενός συνημιτόνου με συχνότητα f = 40 Hz
"""

# create data
f = 40
T = 1/f
w = 2*np.pi*f # γωνιακή συχνότητα
n_seq = 100   # number of sequences
n_points = 10  # sample points

sin_waves = np.zeros((n_seq, n_points))
cos_waves = np.zeros((n_seq, n_points))

for i in range(n_seq):
    
    A = np.random.uniform(1,10) #pick random amplitude
    #random starting point and ending point of the cosine/sine
    start = np.random.uniform(0, T) 
    final = start + n_points*0.001  

    t = np.linspace(start, final, n_points)
    
    sin_waves[i] = A*np.sin(w*t)
    cos_waves[i] = A*np.cos(w*t)


# we plot some of our generated data
fig = plt.figure(figsize=(24,7))
for i in range(5):  # sin
    fig.add_subplot(2, 5, i+1)
    plt.plot(np.arange(10), sin_waves[i])
for i in range(5): # cosine
    fig.add_subplot(2, 5, i+6)
    plt.plot(np.arange(10), cos_waves[i], color='darkorange')
plt.show()

"""**ΒΗΜΑ 9**

### Διαχωρισμός Δεδομένων
"""

# Βοηθητικός κώδικας εργαστηρίου

def parse_free_digits(directory):
    # Parse relevant dataset info
    files = glob(os.path.join(directory, "*.wav"))
    fnames = [f.split("/")[1].split(".")[0].split("_") for f in files]
    ids = [f[2] for f in fnames]
    y = [int(f[0]) for f in fnames]
    speakers = [f[1] for f in fnames]
    _, Fs = librosa.core.load(files[0], sr=None)

    def read_wav(f):
        wav, _ = librosa.core.load(f, sr=None)

        return wav

    # Read all wavs
    wavs = [read_wav(f) for f in files]

    # Print dataset info
    print("Total wavs: {}. Fs = {} Hz".format(len(wavs), Fs))

    return wavs, Fs, ids, y, speakers


def extract_features(wavs, n_mfcc=6, Fs=8000):
    # Extract MFCCs for all wavs
    window = 30 * Fs // 1000
    step = window // 2
    frames = [
        librosa.feature.mfcc(
            wav, Fs, n_fft=window, hop_length=window - step, n_mfcc=n_mfcc
        ).T

        for wav in tqdm(wavs, desc="Extracting mfcc features...")
    ]

    print("Feature extraction completed with {} mfccs per frame".format(n_mfcc))

    return frames


def split_free_digits(frames, ids, speakers, labels):
    print("Splitting in train test split using the default dataset split")
    # Split to train-test
    X_train, y_train, spk_train = [], [], []
    X_test, y_test, spk_test = [], [], []
    test_indices = ["0", "1", "2", "3", "4"]

    for idx, frame, label, spk in zip(ids, frames, labels, speakers):
        if str(idx) in test_indices:
            X_test.append(frame)
            y_test.append(label)
            spk_test.append(spk)
        else:
            X_train.append(frame)
            y_train.append(label)
            spk_train.append(spk)

    return X_train, X_test, y_train, y_test, spk_train, spk_test


def make_scale_fn(X_train):
    # Standardize on train data
    scaler = StandardScaler()
    scaler.fit(np.concatenate(X_train))
    print("Normalization will be performed using mean: {}".format(scaler.mean_))
    print("Normalization will be performed using std: {}".format(scaler.scale_))
    def scale(X):
        scaled = []

        for frames in X:
            scaled.append(scaler.transform(frames))
        return scaled
    return scale


def parser(directory, n_mfcc=6):
    wavs, Fs, ids, y, speakers = parse_free_digits(directory)
    frames = extract_features(wavs, n_mfcc=n_mfcc, Fs=Fs)
    X_train, X_test, y_train, y_test, spk_train, spk_test = split_free_digits(
        frames, ids, speakers, y
    )

    return X_train, X_test, y_train, y_test, spk_train, spk_test

# Εξαγωγή των training και των test δεδομένων
X_train, X_test, y_train, y_test, spk_train, spk_test = parser('recordings', n_mfcc=6)

# Χωρισμός των training δεδομένων σε train και validation
X_train, X_val, y_train, y_val = train_test_split(X_train, y_train, test_size=0.2, stratify=y_train)

print("Number of train samples: " + str(len(X_train)))

print("Number of test samples: " + str(len(X_test)))

print("Number of validation samples: " + str(len(X_val)))

"""**ΒΗΜΑ 10**

### Αναγνώριση ψηφίων με GMM-HMM

Πλέον, αφού χωρίσαμε σε train(2700) και testing(300) το dataset μας(3000) με τη βοήθεια της συνάρτησης parser, χωρίσαμε επίσης τα training δεδομένα σε training(2160) και validation(540) με ποσοστό 80%-20%. 
Ο πίνακας X_train_s που θα χρησιμοποιήσουμε έχει επομένως 2160 samples (εκφωνήσεις) για κάθε μια απο τις οποίες έχουμε έναν αριθμό απο 6 mfccs για κάθε window του αρχείου recording. Πχ για το πρώτο sample, διαθέτουμε 34 windows και 6 mfccs για κάθε window, συνολικά 204 χαρακτηριστικά.

O πίνακας y περιέχει τα αντίστοιχα labels για κάθε sample.
"""

# Στο πίνακα digits περιέχονται τα στοιχεία για κάθε ψηφίο. 
# Στη i-γραμμή του πίνακα βρίσκονται τα δεδομένα για το i-οστό ψηφίο
digits = []  

X_train_np = np.array(X_train)
y_train_np = np.array(y_train)
for i in range(10):
    digits.append(X_train_np[y_train_np==i])

# Ορισμός της συνάρτησης που θα αρχικοποιεί τα μοντέλα για κάθε ψηφίο   
def EM_algorithm(X, n_states, n_mixtures, gmm=True, max_iterations=30, stop_threshold=1e-9):
    dists = []
    for i in range(n_states):
        if gmm and n_mixtures>1:
            a = GeneralMixtureModel.from_samples(MultivariateGaussianDistribution, n_mixtures, np.float_(np.vstack(X)))
        else:
            a = MultivariateGaussianDistribution.from_samples(np.float_(np.vstack(X)))
        dists.append(a)

    # transition matrix
    trans_mat = np.zeros((n_states,n_states))
    for i in range(n_states):
        for j in range(n_states):
            if i == j or j == i+1:
                trans_mat[i,j] = 1  

    # starting probabilities
    starts = np.zeros(n_states)
    starts[0] = 1

    # ending probabilities
    ends = np.zeros(n_states)
    ends[-1] = 1

    # Define the GMM-HMM
    model = HiddenMarkovModel.from_matrix(trans_mat, dists, starts, ends, state_names=['s{}'.format(i) for i in range(n_states)])

    # Fit the model 
    model.fit(X, max_iterations=max_iterations, stop_threshold=stop_threshold)

    return model

"""**ΒΗΜΑ 11**

### Expectation Maximization

Ορίζουμε τη συνάρτηση train_HMM η οποία θα χρησιμοποιηθεί στη συνέχεια για την εκπαίδευση των 10 μοντέλων (ένα για κάθε ψηφίο).

Συγκεκριμένα, η συνάρτηση αυτή θα επιστρέφει μία λίστα models η οποία θα περιέχει ένα αρχικοποιημένο μοντέλο (μέσω της συνάρτησης em που ορίσαμε προηγουμένως) για κάθε ένα ψηφίο.
"""

def train_HMM(X, n_states, n_mixtures, max_iterations, gmm=True, stop_threshold=1e-9):
    models = []
    for i in range(10):
        models.append(EM_algorithm(X[i], n_states, n_mixtures, max_iterations, gmm, stop_threshold))
    return models

"""**ΒΗΜΑ 12**

### Αναγνώριση μεμονωμένων ψηφίων – Testing

Αρχικά, ορίζουμε μια συνάρτηση evaluate που θα χρησιμοποιήσουμε για να κάνουμε evaluate κάθε πιθανό μοντέλο, υπολογίζοντας την πιθανοφάνεια και το accuracy
"""

# function to evaluate models
def evaluate(HMMs, X, y):
    y_pred = [] # HMM predictions
    for seq in range(len(X)):
        logPs = []  # log likelihoods
        for HMM in range(10):
            logP, _ = HMMs[HMM].viterbi(X[seq])
            logPs.append(logP)
        y_pred.append(np.argmax(np.array(logPs)))
    
    accuracy = accuracy_score(y, y_pred)
    confusion_mat = confusion_matrix(y, y_pred)

    return accuracy, confusion_mat

"""Ακολούθως, για τις εξής τιμές των παραμέτρων:

state = [ 1, 2, 3, 4 ] *αριθμός καταστάσεων HMM*

mixture = [ 1, 2, 3, 4, 5 ] *Γκαουσιανές κατανομές*

iterations = [ 5, 10, 15, 20, 25, 30 ] *αριθμός επαναλήψεων*

1. Καλούμε τη συνάρτηση train η οποία μας επιστρέφει 10 μοντέλα με τις παραμέτρους που δόθηκαν, ένα για κάθε ψηφίο

2. Κάνουμε evaluate τα μοντέλα αυτά μέσω της συνάρτησης evaluate και κρατώντας το accuracy

3. Βρίσκουμε το καλύτερο accuracy [opt_accuracy] κάθε φορά

4. Αποθηκέουμε στη λίστα op_hp τις παραμέτρους state, mixtuter, iteration για το καλύτερο, μέχρι στιγμής, μοντέλο

"""

# hyperparameter optimization
opt_accuracy = 0
for state in range(1,5):
    for mixture in range(1,6):
        for i in range(5,31,5):
            HMMs = train_HMM(digits, state, mixture, True, i)
            accuracy, _ = evaluate(HMMs, X_val, y_val)
            if accuracy > opt_accuracy:
                opt_hp = [state, mixture, i]
                opt_HMMs = HMMs
                opt_accuracy = accuracy

"""Εκτυπώνουμε τις βέλτιστες παραμέτρους"""

# collect the optimal hyperparameters
print("Optimal Number of States: {}".format(opt_hp[0]))
print("Optimal Number of Mixtures: {}".format(opt_hp[1]))
print("Optimal Number of Iterations: {}".format(opt_hp[2]))

